- TextSection:
  - Contents: Acroosteolysis dominant type (AOD) is a rare genetic osteolysis syndrome
      characterized by acroosteolysis of distal phalanges and generalized osteoporosis,
      associated with additional ossification anomalies, craniofacial dysmorphism,
      dental anomalies and a wide range of other characteristics.
    Name:
    - label: Disease definition
      lang: en

